import React, { Component } from "react";
import { Route, Link } from "react-router-dom";

class ChatForm extends Component {
  state = {
    text: ""
  };
  render() {
    return (
      <div>
        <input type="text" />
        <Link to="/chat">Join</Link>
        {/* <Route path="/chat" component={ChatForm}></Route> */}
      </div>
    );
  }
}

export default ChatForm;
